import "./static/css/header.css";
import { Link } from "react-scroll";

const Header = () => {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark sty">
        <li className="navbar-brand ms-2">
          <Link
            activeClass="active"
            to="home"
            // spy={true}
            smooth={true}
            // offset={50}
            duration={500}
            // onSetActive={this.handleSetActive}
          >
            Porfolio
          </Link>
        </li>
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav ms-auto me-2">
            <li className="nav-item active">
              <Link
                activeClass="active"
                to="home"
                // spy={true}
                smooth={true}
                // offset={50}
                duration={500}
                // onSetActive={this.handleSetActive}
              >
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="projects"
                // spy={true}
                smooth={true}
                // offset={50}
                duration={500}
                // onSetActive={this.handleSetActive}
              >
                Projects
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="skills"
                spy={true}
                smooth={true}
                offset={50}
                duration={500}
                onSetActive={this.handleSetActive}
              >
                Skills
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="/exp"
                spy={true}
                smooth={true}
                offset={50}
                duration={500}
                onSetActive={this.handleSetActive}
              >
                Experience
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="/contact"
                spy={true}
                smooth={true}
                offset={50}
                duration={500}
                onSetActive={this.handleSetActive}
              >
                Contact
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default Header;
